export default function list(info) {
  console.log(info);
  info.map((x) => console.log(x));
  return (
    <ul>
      <li>
        <div className="flex">
          <img src="" alt="img" />
          <div className="title">
            <h3 className="name">Person Name</h3>
            <h5 className="age">Age</h5>
          </div>
        </div>
      </li>
    </ul>
  );
}
